An early season update from some of our #ProBears out on the tour! Congrats to these champions and finalists. They are off to a strong start! 

@charlie_broom1 has captured three titles (one singles and two doubles) along with another finals appearance already this season. He now sits inside the top 300 in both singles and doubles, again.

@markomiladinovic127 won his first pro title in over six years as he begin his first full year on the pro tour. He was the @itfworldtennistour mover of the week recently has he jumped into the top 800 ATP.

@oskar.brostrom won his 6th pro doubles title and has been selected by Denmark to represent his country in Davis Cup for the first time. 

@matisototenis has made the singles final in his first two events this year to move inside 300 ATP. 

Last, but certainly not least, @johnwpeers captured his fourth grand slam title as he defended his mixed doubles title in Melbourne at the Australian Open.

